import React from 'react'
import './App.css';
import Tabs from './Tabs';
import Tab from './Tab';

class App extends React.Component {

  constructor(props) {
    super(props)
    this.state = {
      selected : 'Home'
    }
  }
  setSelected = (tab) =>{
    this.setState({selected: tab})
  }
  render() {
    return (
      <div className="App mt-4">
        <Tabs tabs= {['1 Minutes','5 Minutes', '1 Hour', '1 Week']} selected = {this.state.selected} setSelected={this.setSelected}></Tabs>
        <Tab isSelected={ this.state.selected === 'Home'}>
        </Tab>
        <Tab isSelected={ this.state.selected === 'Settings'}>
        <h1>Hello</h1>
        </Tab>
        <Tab isSelected={ this.state.selected === 'Profile'}>
        <p>Hi from Profile</p>
        </Tab>
      </div>
    );
  }
}

export default App;
